import React, { useContext } from 'react'
import { AppBar, Typography } from '@material-ui/core'
import { Link } from 'react-router-dom'
import { AuthContext } from './Auth'



function Header() {
    const { currentUser } = useContext(AuthContext)
    return (

        <AppBar position="static" style={{ height: "3rem" }}>
            <Link to="/" style={{ margin: "auto 0", textDecoration: "none", color: "white" }}>Home</Link>
            <Typography style={{ float: "right" }}>Logged in as {currentUser.email !== null ? currentUser.email : "boi"}</Typography>
        </AppBar>

    )

}

export default Header
